INSERT INTO `categories` (`id`, `title`, `category_desc`, `image`, `POG_status`, `status`, `created`) VALUES
(1, 'Games', 'indoor and our door games ', '14883785423740G.jpg', '0', '1', '2017-03-01 14:29:02'),
(2, 'Food', ' veg nonveg food', '1488378603ZI37P.jpg', '0', '1', '2017-03-01 14:30:03'),
(3, 'Fashion', 'Fashion is a popular style or practice, especially in clothing, footwear, accessories, makeup, body, or furniture. Fashion is a distinctive and often constant trend in the style in which a person dresses. It is the prevailing styles in behaviour and the newest creations of textile designers.[1] Because the more technical term costume is regularly linked to the term \"fashion\", the use of the former has been relegated to special senses like fancy dress or masquerade wear, while \"fashion\" generally means clothing, including the study of it. Although aspects of fashion can be feminine or masculine, some trends are androgynous.', '148837864558K58.jpg', '0', '1', '2017-03-01 14:30:45'),
(4, 'Trips', 'We want to give our guests a deeper, fuller understanding of Mumbai through our day tours. When we design a tour, we aim to combine Mumbai’s must-see sights with hidden gems that surprise even lifelong Mumbaikars. For example, our Bicycle Tour uses an unexpected form of Mumbai transport to introduce guests to iconic South Mumbai sights like the Gateway of India and CST Station as well as some lesser known places that are difficult to discover on your own such as Sassoon Dock and Bombay Panjrapole (cow sanctuary). Our goal is to help you get closer, understand better, and experience more.', '14883786766TZ5Z.jpg', '0', '1', '2017-03-01 14:31:16'),
(5, 'Miscellaneous', ' others', '1488378728JP5DB.jpg', '0', '1', '2017-03-01 14:32:08'),
(6, 'LifeStyle', 'Lifestyle is an Indian fashion retailer chain promoted by the Landmark Group. It started in the year 1999 with its first store located in Chennai.  ', '1490189354J0ZU8.jpg', '0', '1', '2017-03-22 13:29:14');
