INSERT INTO `contents` (`id`, `title`, `content`, `is_deleted`) VALUES
(1, 'Privacy Policy', '<p><em><strong>What information do we collect?</strong></em></p>\r\n\r\n<p>We collect information from you when you register on our site, place an order, respond to a survey or fill out a form.<br />\r\n<br />\r\nWhen ordering or registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address, phone number or credit card information.</p>\r\n\r\n<p><strong>What do we use your information for? </strong></p>\r\n\r\n<p>Any of the information we collect from you may be used in one of the following ways:</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&bull;To personalize your experience (your information helps us to better respond to your individual needs);</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&bull;To improve customer service (your information helps us to more effectively respond to your customer service requests and support needs);</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&bull;To process transactions (Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.);</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&bull;To administer a contest, promotion, survey or other site feature;</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&bull;To send periodic emails (The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.)</p>\r\n\r\n<p>Note: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</p>\r\n\r\n<p><strong>How do we protect your information? </strong></p>\r\n\r\n<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.</p>\r\n\r\n<p>We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway provider&rsquo;s database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential.</p>\r\n\r\n<p>After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</p>\r\n\r\n<p><strong>Do we use cookies? </strong></p>\r\n\r\n<p>Yes. Cookies are small files that a site or its service provider transfers to your computer&#39;s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information.</p>\r\n\r\n<p>We use cookies to help us remember and process the items in your shopping cart.</p>\r\n\r\n<p><strong>Do we disclose any information to outside parties? </strong></p>\r\n\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n\r\n<p><strong>Third party links </strong></p>\r\n\r\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n\r\n<p><strong>Children&#39;s Online Privacy Protection Act Compliance </strong></p>\r\n\r\n<p>We are in compliance with the requirements of COPPA (Children&#39;s Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.</p>\r\n\r\n<p><strong>Your Consent </strong></p>\r\n\r\n<p>By using our site, you consent to our website&#39;s privacy policy.</p>\r\n\r\n<p><strong>Changes to our Privacy Policy</strong></p>\r\n\r\n<p>Any changes to our privacy policy will be posted on this page.</p>\r\n\r\n<p><strong>Contacting Us </strong></p>\r\n\r\n<p>If there are any questions regarding this privacy policy you may contact us at <a href=\"mailto:info@look4fitness.com\">info@look4fitness.com</a>.&nbsp;</p>\r\n', 0),
(2, 'Terms & Conditions', '<p>Please use this temporary text for the privacy policy:</p>\n\n<p><strong>What information do we collect?</strong></p>\n\n<p>We collect information from you when you register on our site, place an order, respond to a survey or fill out a form.</p>', 1),
(3, 'About Us', '<p><em>Are you looking for the perfect personal trainer or the hottest new group class in your area?</em><br />\r\n<br />\r\nIf you&rsquo;re overwhelmed or maybe even underwhelmed by what you&rsquo;re finding online, don&rsquo;t waste any more time searching multiple websites. Look 4 Fitness will find what you need quickly, so you can step away from the browser and get moving!<br />\r\n<br />\r\n<em>What if you need a sub for your group exercise class this afternoon and it&rsquo;s already 11am?</em><br />\r\n<br />\r\nSay goodbye to the stress of frantically emailing and texting every instructor you know. Use Look 4 Fitness to find a list of qualified and available candidates, fast!<br />\r\n<br />\r\nIf you are a facility or an instructor, you can also post temporary or permanent jobs &ndash; and market yourself to new clients!<br />\r\n<br />\r\nWhether you are an instructor, facility or participant, Look 4 Fitness is your one-stop destination for dance and fitness instruction, products and services. From boot camp to ballet - and even a post-workout massage, it&rsquo;s fitness at your fingertips! <strong>Join look4fitness.com today!</strong></p>\r\n', 0),
(4, 'FAQ', '<h4>Do I need to become a member to use this site?</h4>\r\n<p>Anyone can use the search features on the home page of our site, but to view instructor profiles, job postings or class details, you will need to register with your name and email address.</p>\r\n<p>For the general public (“Customers”) and Instructors with basic memberships, registrationis FREE!</p>\r\n<p>If you are a gym, school, fitness center or studio (“Faculty”), or an Instructor with a Premium Membership (monthly or annual subscription) you will receive a series of additional benefits.  A list of benefits can be found by clicking the Instructor or Facility membership buttons on the home page of the website.</p>\r\n<h4>How do I join?</h4>\r\n<p>Choose the appropriate membership category on the home page of the site, and click “Sign Up” or go to the top right corner and click the orange “Member Login” button.  If you haven’t already registered, it will give you the option to sign up. </p>\r\n<h4>How much is a membership?</h4>\r\n<ul>\r\n	<li>• <span><strong>Customer Memberships</strong> are free!</span></li>\r\n	<li>• <span><strong>Basic Instructor Memberships</strong> are free!</span></li>\r\n	<li>• <span><strong>Premium Instructor Memberships</strong> are $19.99/month, or $199/year (2 months free).</span></li>\r\n	<li>• <span><strong>Facility Memberships</strong> are $29.99/month or $299/year (2 months free).</span></li>\r\n</ul>\r\n<h4>Where would I find an event near me?</h4>\r\n<p>On the home page of the site there is an “Events” box that features all of the events taking place in your area, based on your IP address or a city you select. Or, click “Events” at the top right of each page.</p>\r\n<h4>Where would I find a class near me?</h4>\r\n<p>On the home page of the site is a “Today’s Classes” box, which shows all of the classes in your area, which you can filter by class type. “Today’s Classes” can also be found at the top of each page of the site.</p>\r\n<p>There is also a main search box, where you can look for facilities or instructors in your area,based on your IP address or a city you select.</p>\r\n<h4>Can I leave a review for the instructor or facility?</h4>\r\n<p>You can leave a review for Premium Instructors and Facilities on their profile pages.</p>\r\n<h4>How do I access or edit my profile?</h4>\r\n<p>Once you have logged in to the site, you will automatically go to your profile page.  You will also notice your name and picture in the top right corner. If you leave your profile and want to get back to it, simply click on your name/picture and it will bring you back to your profile.</p>\r\n<h4>I have a technical problem, who do I contact?</h4>\r\n<p>If you are already in your account, simply click “Contact Us” (bottom left of your side panel). If you are unable to access your account, please leave us a detailed message using the “Contact” button (under “Support” at the bottom of each page of the site), or call 1-800-948-3006.  We will respond as soon as we can.</p>\r\n<h4>How do I change or cancel my membership?</h4>\r\n<p>You can upgrade or downgrade your membership using “Manage Account” towards the bottom left of your profile page.  If you’d like to close your account, click Contact us” (bottom left of your page) and we will close your account.</p>\r\n<h4>What is your privacy policy?</h4>\r\n<p>Our privacy policy is outlined under “Privacy Policy” under “Support” at the bottom of each page</p>\r\n<h4 style=\"text-decoration:underline;\">Instructors</h4>\r\n<h4>What if the class/specialty I teach or my credential type is not listed?</h4>\r\n<p>Please click “Contact Us” from your profile page and request your class/credential.  We are always happy to add new formats and credentials as needed! </p>\r\n<h4>Can I link my account with another member?</h4>\r\n<p>Yes! If you are an instructor and the facility you work for is also a member, you can cross link to each other by clicking “Manage Facility”.  You can also add the facility’s name to any classes you schedule on your profile (but only if they are a member).</p>\r\n<p>This way, when someone searches for classes, it will show both your account and a link to your facility’s account, and vice versa.  If your facility is not a member, it will say “ask instructor” and they can message you to ask where the class is taking place.</p>\r\n<h4>How do I find a sub for my class?</h4>\r\n<p>If you are a Basic Instructor, you can search on your class type and location in the search box on the main page, and contact any appropriate instructors that appear in the results.</p>\r\n<p>If you are a Premium Instructor you can use “Power Search”, which allows you to find an instructor using much more detailed criteria, such as the days/times they are available, interest in subbing or permanent positions, credentials, CPR, insurance, fitness specialties, where they can travel etc.).</p>\r\n<p>Once you have refined your list of instructors, you can contact all of them at once (or just a select few) and the message will go to their look4fitness inbox, their phone via text and their email.  You can then select an instructor who replies to your message, and send another group message indicating you have filled the position.  It’s a constantly updated list of staff that fit the exact criteria you are looking for with a click of a button!</p> \r\n<h4>How do I apply for jobs?</h4>\r\n<p>You can either visit the Jobs page, or, if a facility or premium instructor posts a job, and you fit the qualifications, the job will be delivered to your inbox!</p>\r\n<h4>How do I promote my classes/events?</h4>\r\n<p>Simply go to “add a class” or “post an event” on the side panel of your profile, and your class or event will show up whenever someone does a search!</p>\r\n<h4>How do I post articles/content?</h4>\r\n<p>Go to “Add Articles” on the side panel of your profile to add your own content!</p>\r\n<h4 style=\"text-decoration:underline;\">Facilities</h4>\r\n<h4>How do I hire an instructor/trainer/coach?</h4>\r\n<p>You can either do a search for the criteria you are looking for using Power Search and contact a member instructor directly, OR you can post a job on the job board. If an instructor is a match, your job will go directly into their in-box!</p>\r\n<h4>What is Power Search?</h4>\r\n<p>“Power Search” allows you to find an instructor using much more detailed criteria, such as the days/times they are available, interest in subbing or permanent positions, credentials, CPR, insurance, fitness specialties, where they can travel etc.).</p>\r\n<p>Once you have refined your list of instructors, you can contact all of them at once (or just a select few) and the message will go to their look4fitness inbox, their phone via text and their email.  You can then select an instructor who replies to your message, and send another group message indicating you have filled the position.  It’s a constantly updated list of staff that fit the exact criteria you are looking for with a click of a button!</p>\r\n<h4>How do I post a job?</h4>\r\n<p>Click “Post a Job” on the side panel of your profile. You can post unlimited jobs with your membership!</p>\r\n<h4>Can my instructors link to my account?</h4>\r\n<p>Yes! If your instructor is also a member, you can cross link to each other by clicking “Manage Instructor”.  You can also add the instructor’s name to any classes you schedule on your profile.</p>\r\n<p>This way, when someone searches for classes, it will show both your account and a link to your instructor’s account, and vice versa.  If your instructor is not a member, it will say “ask facility” and they can message you to ask who is teaching the class.</p>\r\n<h4>Can several locations use the same account?</h4>\r\n<p>Yes, if you all share the same username and password, however, each account only has one address, and you would not be able to add each location’s classes to your profile, so it would likely not be practical to share one account.</p>\r\n<h4>What if I want to use the site but don’t want my facility to appear in searches?</h4>\r\n<p>We are adding a handy “Hide My Profile” button that you can click whenever you want to be “incognito”! </p>\r\n<h4>How do I market my classes/events?</h4>\r\n<p>All of your classes and events will appear in searches from the home page (Events box, Today’s Classes box, main search screen) based on the user’s IP address.  You can also include your website and social media on your profile, so that users can check out all you have to offer!</p>\r\n', 0),
(5, 'Testimonials', '<h2>What is Lorem Ipsum?</h2>\r\n\r\n<p style=\"text-align:justify\"><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', 0);
