INSERT INTO `email_templates` (`id`, `title`, `subject`, `content`, `created`) VALUES
(1, 'User Registration.', 'Welcome to [SITE NAME]', '<p><span style=\"background-color:white; font-family:arial,sans-serif; font-size:9pt\">Dear [NAME],</span></p>\r\n\r\n<p style=\"text-align:justify;font-family:arial,sans-serif; font-size:9pt\">Welcome to GrouperUSA.com.We thank you for registering with us as User.</p>\r\n\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">In order to access your account you will need to click on the link below and then your account will be activated.</p>\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">Link: [LINK]</p>\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">Should you have any questions, please visit our FAQ section. </p>\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt>Have you downloaded our App yet?  If not simply go to GrouperUSA.com and find the download link at the bottom of our Home Page!  Communicating with your Groups has never been so fun!\r\n</p>\r\n\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">Kind regards,</p>\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">The GrouperUSA Team</p>\r\n', '2012-06-13 08:54:49'),
(2, 'Group Invitation', 'Group Invitation from [SITE NAME]', '<p>\r\n	Hi, [RECEIVER NAME] </p>\r\n<p>[SENDER NAME] has requested you join the [GROUP TYPE] group, “[GROUP NAME]” on the website, GrouperUSA.com.  To join simply click on the link provided below and follow the instructions.</p>\r\n <p> [SITEURL]</p>\r\n<p>Membership to GrouperUSA is free, and anyone can create private groups of any size for messaging, document sharing, scheduling events, seeing other community events, and getting great deals from local businesses.</p>\r\n<p>Download our App and you can communicate with all your Friends, Groups, or Leagues on the Go!  Thanks for giving us a try and supporting your community!</p>\r\n<p>The GrouperUSA Team</p>\r\n', '2017-03-28 03:23:40'),
(3, 'Friend Invitation', 'Friend Invitation from [SITE NAME]', '  <p><span style=\"background-color:white; font-family:arial,sans-serif; font-size:9pt\">Dear [RECEIVER NAME],</span></p>\r\n\r\n\r\n<p style=\"text-align:justify\"; font-family:arial,sans-serif; font-size:9pt>[SENDER NAME]  has invited you to join Grouper.</p>\r\n\r\n<p style=\"text-align:justify\"; font-family:arial,sans-serif; font-size:9pt>To accept the invitation you need to subscribe to <a href=\"https://www.grouperusa.com/\">https://www.grouperusa.com/</a></p>\r\n\r\n\r\n\r\n<p style=\"text-align:justify\"; font-family:arial,sans-serif; font-size:9pt>Grouper Team</p>\r\n\r\n<p style=\"text-align:justify\"; font-family:arial,sans-serif; font-size:9pt><a href=\"https://www.grouperusa.com/\">https://www.grouperusa.com/</a></p>\r\n\r\n<p style=\"text-align:justify; font-family:arial,sans-serif; font-size:9pt\">&nbsp;</p>', '2017-03-28 03:23:40'),
(4, 'Contact Us', 'Contact Us Enquiry', '<p>\n	Hi, Grouper Admin</p>\n<p>\n	[QUERYTYPE]</p>\n <p> PHONE-[PHONE]</p>\n\n <p> EMAIL-[EMAIL]</p>\n<p>\n	[MESSAGE]</p>\n<p>\n	Thanking you</p>\n<p>\n	[USERNAME] </p>\n', '2017-05-02 05:28:39'),
(5, 'Event Notification', 'Event Notification', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> [SENDERNAME] sent you an event reminder</p>\r\n\r\n<p> Event Details</p>\r\n\r\n<p>Event Reminder for [GROUPTYPE] group :  [GROUPNAME] </p>\r\n<p>Event Title:  [EVENTNAME] </p>\r\n<p>Event Time:  [EVENTTIME] </p>\r\n<p>Location:  [EVENTLOCATION]</p>\r\n\r\n<p>\r\n	Thanking you</p>\r\n<p>\r\n	[SENDERNAME] </p>\r\n', '2017-05-02 05:28:39'),
(6, 'Join Now Request', 'Join Now Request', '<p>\n	Hi, [USERNAME] </p>\n<p> [SENDERNAME]  requested to join your [GROUPTYPE] group [GROUPNAME].</p>\n<p>\n	Thanking you</p>\n<p>\n	[SENDERNAME] </p>\n', '2017-05-12 00:00:00'),
(7, 'Invitation Request', 'Invitation Request', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p>[SENDERNAME] has requested you join the [GROUPTYPE] group, [GROUPNAME] on the website, GrouperUSA.com.  To join simply click on the link provided below and follow the instructions.</p>\r\n <p> [SITEURL]</p>\r\n<p>Membership to GrouperUSA is free, and anyone can create private groups of any size for messaging, document sharing, scheduling events, seeing other community events, and getting great deals from local businesses.</p>\r\n<p>Download our App and you can communicate with all your Friends, Groups, or Leagues on the Go!  Thanks for giving us a try and supporting your community!</p>\r\n<p>The GrouperUSA Team</p>\r\n\r\n', '2017-05-12 00:00:00'),
(8, 'Recommendation', 'Recommendation', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p>[SENDERNAME] has recommended that you join the [GROUPTYPE] Group: “[GROUPNAME]” on the App and Website, GrouperUSA.com.  To request to join the Group simply click on the link below.  </p>\r\n <p> [SITEURL]</p>\r\n<p>Have you downloaded our App yet?  If not simply go to GrouperUSA.com and find the download link at the bottom of our Home Page!  Communicating with your Groups has never been so fun!</p>\r\n<p>The GrouperUSA Team</p>\r\n', '2017-05-12 00:00:00'),
(9, 'Reject Invitation', 'Reject Invitation', '<p>\n	Hi, [USERNAME] </p>\n<p> [SENDERNAME]  rejected your invitation to join [GROUPTYPE] group [GROUPNAME].</p>\n<p>\n	Thanking you</p>\n<p>\n	[SENDERNAME] </p>\n', '2017-05-12 00:00:00'),
(10, 'Reject Request', 'Reject Request', '<p>\n	Hi, [USERNAME] </p>\n<p> [SENDERNAME]  rejected your request to join [GROUPTYPE] group [GROUPNAME].</p>\n<p>\n	Thanking you</p>\n<p>\n	[SENDERNAME] </p>\n\n', '2017-05-12 00:00:00'),
(11, 'Reject Recommendation', 'Reject Recommendation', '<p>\n	Hi, [USERNAME] </p>\n<p> [SENDERNAME]  rejected your recommendation to join [GROUPTYPE] group [GROUPNAME].</p>\n<p>\n	Thanking you</p>\n<p>\n	[SENDERNAME] </p>\n\n', '2017-05-12 00:00:00'),
(12, 'Accept Invitation', 'Accept Invitation', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> [SENDERNAME]  accepted your invitation to join [GROUPTYPE] group, [GROUPNAME]. Thank you for using GrouperUSA and supporting Your Community!</p>\r\n<p>\r\n	The GrouperUSA Team</p>\r\n\r\n\r\n', '2017-05-12 00:00:00'),
(13, 'Accept Request', 'Accept Request', '<p>\n	Hi, [USERNAME] </p>\n<p> [SENDERNAME]  accepted your request to join [GROUPTYPE] group [GROUPNAME].</p>\n<p>\n	Thanking you</p>\n<p>\n	[SENDERNAME] </p>\n\n', '2017-05-12 00:00:00'),
(14, 'Accept Recommendation', 'Accept Recommendation', '<p>\r\nHi, [USERNAME] </p>\r\n<p> [SENDERNAME]  accepted your recommendation to join [GROUPTYPE] group, [GROUPNAME]. Thank you for being a valued Grouper on GrouperUSA.com and supporting the local businesses in your community!  </p>\r\n\r\n<p>Have you tried our mobile app yet?  We offer a mobile app for both Android and iPhones.  Download it for free using the link provided below so you can keep up with your events, community events, communicate with your groups, chat with friends, and get great discounts from local businesses while on the go!</p>\r\n\r\n<p>Respectfully</p>\r\n<p>The GrouperUSA Team</p>\r\n', '2017-05-12 00:00:00'),
(15, 'Friend Request', 'Friend Request', '<p>Hi, [USERNAME] </p>\r\n<p> [SENDERNAME]  has sent you a friend request on GrouperUSA.com.  Please login to the website or the GrouperUSA app and check your notifications at the top of the page so that you can Accept or Deny this request.  Thank you for being a Grouper and please tell your friends about us!</p>\r\n\r\n<p>Grouper Team</p>', '2017-05-12 00:00:00'),
(16, 'Accept Friend Request', 'Accept Friend Request', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> [SENDERNAME]  accepted your friend request on GrouperUSA.com.  Friends will show up on your \"My Friends\" section of the menu bar allowing you to message each other freely.  Please Create as many Private Groups as you like for messaging, document sharing, and scheduling events. Thank you for being a Grouper and please tell your friends about us!</p>\r\n\r\n<p>\r\n	The GrouperUSA Team </p>\r\n', '2017-05-12 00:00:00'),
(17, 'Reject Friend Request', 'Reject Friend Request', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> [SENDERNAME]  denied your friend request on GrouperUSA.com.  Friends will show up on your “My Friends” section of the menu bar allowing you to message each other freely.  Please Create as many Private Groups as you like for messaging, document sharing, and scheduling events.  Our service is Free for all Private Groups and only $2/day for Public Business Groups.  Thank you for being a Grouper and please tell your friends about us!</p>\r\n\r\n<p>\r\n	The GrouperUSA Team </p>\r\n', '2017-05-12 00:00:00'),
(18, 'Push Message', 'Push Message', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> [SENDERNAME] owner of [GROUPTYPE] group [GROUPNAME], has sent you the following Push Message.  </p>\r\n<p> Message : [MESSAGE] </p>\r\n<p>\r\n	Thanks,</p>\r\n<p>\r\n	[SENDERNAME] </p>\r\n<p>Thank you for using GrouperUSA and supporting your community!</p>\r\n', '2017-05-12 00:00:00'),
(19, 'Message', 'Admin Message', '<p>\r\n	Hi, [USERNAME] </p>\r\n<p> The Administrator at GrouperUSA has sent you the following message:</p>\r\n<p> Message : [MESSAGE] </p>\r\n<p> Thank you for being a loyal Grouper and using GrouperUSA.com.  </p>\r\n<p>\r\n	Respectfully,</p>\r\n<p>\r\n	GrouperUSA Administrator </p>\r\n', '2017-06-08 20:37:58'),
(20, 'Group Recommendation', 'Group Recommendation from [SITE NAME]', '<p>\r\n	Hi, [RECEIVER NAME] </p>\r\n<p>[SENDER NAME] has recommended that you join the [GROUP TYPE] group, “[GROUP NAME]” on the website, GrouperUSA.com.  Membership to GrouperUSA is free, and anyone can create private groups of any size for messaging, document sharing, scheduling events, seeing other community events, and getting great deals from local businesses.   \r\nSimply click on the link below to quickly get started!  Communicating with your Groups has never been so fun! </p>\r\n <p> [SITEURL]</p>\r\n<p>Want to manage your Friends, Groups, or Leagues On the Go with our App?  Just go to GrouperUSA.com and find the App download link at the bottom of our Home Page!</p>\r\n<p>The GrouperUSA Team</p>', '2017-06-09 17:14:50'),
(21, 'Forgot Password', 'Forgot Password [SITE NAME]', '<p>\r\nHi, [NAME]</p>\r\n\r\n<p>\r\nYou recently requested password help from GrouperUSA.com.  Your password is [PASSWORD].  If you are still having problems logging in after entering this password please send us an email to:  Support@GrouperUSA.com.  Thank you for being a loyal Grouper and using GrouperUSA.com.\r\n</p>\r\n\r\n<p>The GrouperUSA Team</p>\r\n', '2017-06-20 19:42:52'),
(22, 'Change Password Admin', 'Change Password Admin', '<p>\r\n	Hi, [USERNAME]</p>\r\n<p>\r\n<br />\r\nThe Administrator at GrouperUSA has changed your password. <br />\r\n<br />\r\n<p>Current Password : <H1>[PASSWORD]</H1></p>\r\n<p>Thank you for being a loyal Grouper and using GrouperUSA.com.  \r\n</p>\r\n\r\n<p>Respectfully,</p>\r\n\r\n<p>GrouperUSA Administrator</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-06-21 19:45:31'),
(23, 'Change Password', 'Change Password', '<p>\r\n	Hi, [USERNAME]</p>\r\n<p>\r\n<br />\r\nYou have sucessfully changed your password for GrouperUSA. <br />\r\n<br />\r\n<p>Current Password : <H1>[PASSWORD]</H1></p>\r\n<p>Thank you for being a loyal Grouper and using GrouperUSA.com.  \r\n</p>\r\n\r\n<p>Respectfully,</p>\r\n\r\n<p>GrouperUSA Team</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-06-22 13:35:46');
